    'help.HowDoIChangeAPicture_content': '\u0AB5\u0ABF\u0A9C\u0ACD\u0A9E\u0ABE\u0AAA\u0AA8 \u0AAE\u0ABE\u0A82 \u0AAB\u0AC7\u0AB0\u0AAB\u0ABE\u0AB0 \u0A95\u0AB0\u0AB5\u0ABE\u0AA8\u0ABE \u0AAA\u0A97\u0AB2\u0ABE\u0AA8\u0AC1 \u0A85\u0AA8\u0AC1\u0AB8\u0AB0\u0AA8 \u0A95\u0AB0\u0ABF \u0AA8\u0AC7 \u0A86\u0AAA \u0A9A\u0ABF\u0AA4\u0ACD\u0AB0\u0AAE\u0ABE\u0A82 \u0AAB\u0ACB\u0AB0\u0AAB\u0ABE\u0AB0 \u0A95\u0AB0\u0ABF \u0AB6\u0A95\u0ACB \u0A9B\u0ACB. \u0AAB\u0AC7\u0AB0\u0AAB\u0ABE\u0AB0 \u0A95\u0AB0\u0AB5\u0ABE\u0AA8\u0ABE \u0AAA\u0ABE\u0AA8\u0ABE \u0AAE\u0ABE\u0A82 \u0A86\u0AB5\u0AC0\u0AA8\u0AC7, \u0AAB\u0ACB\u0A9F\u0ACB\u0AB8 \u0AA8\u0ABE \u0AB5\u0ABF\u0AAD\u0ABE\u0A97 \u0AAE\u0ABE\u0A82 \u0A9C\u0ABE\u0A93 \u0A85\u0AA8\u0AC7 \u0AAB\u0ACB\u0A9F\u0ACB \u0AB9\u0A9F\u0ABE\u0AB5\u0ABE \u0AAE\u0ABE\u0A9F\u0AC7 \u201C\u0A86 \u0AAB\u0ACB\u0A9F\u0ACB \u0AB9\u0A9F\u0ABE\u0AB5\u0ACB\u201D \u0AAA\u0AB0 \u0A95\u0ACD\u0AB2\u0ABF\u0A95 \u0A95\u0AB0\u0ACB, \u0AA8\u0AB5\u0AC1 \u0A9A\u0ABF\u0AA4\u0ACD\u0AB0 \u0A85\u0AAA\u0AB2\u0ACB\u0AA1 \u0A95\u0AB0\u0AB5\u0ABE \u201C\u0AB9\u0A9C\u0AC0 \u0A8F\u0A95 \u0AAB\u0ACB\u0A9F\u0ACB \u0A89\u0AAE\u0AC7\u0AB0\u0ACB\u201D \u0AAA\u0AB0 \u0A95\u0ACD\u0AB2\u0ABF\u0A95 \u0A95\u0AB0\u0ACB.',
